// Import Libraries
import React, { useState } from "react";

const MainSearchBar = (props) => {
  const [data, setData] = useState({
    question: "",
  });

  const onChangeHandler = (val) => {
    setData({
      ...data,
      data: val,
    });
  };

  const onSubmitHandler = (val) => {
    console.log(val);
  };

  return (
    <div class="w-1/2">
      <div class="h-3 p-5 bg-gradient-to-r from-blue-900 to-pink-100 w-full rounded-2xl justify-items-start ">
        <input
          class="border-white bg-transparent"
          type="search"
          placeholder={props.placeholder}
          onChange={(val) => onChangeHandler(val)}
          onSubmit={onSubmitHandler}
        />
        <button class="h-3" />
      </div>
    </div>
  );
};

export default MainSearchBar;
